type HookProps = ReturnType<typeof useSignUP>



export default function SignUp(props: SignUpProps) {
    const hookProps = useSignUP(props)
    return (
        <div className="fixed w-screen h-screen top-0 left-0 flex justify-center items-center ">
            {hookProps.slide === 1 && <SlideOne {...hookProps} />}
            {hookProps.slide === 2 && <SlideTwo {...hookProps} />}
            {hookProps.slide === 3 && <SlideThree {...hookProps} />}
            {hookProps.slide === 4 && <SlideFour {...hookProps} />}
            {hookProps.slide === 5 && <SlideFive {...hookProps} />}
        </div>
    )
}

